import styled from "styled-components"

const Header = styled.div`
    height:70px;
    font-weight:700;
    color:white;
    z-index:100;
    font-size:1.2em;
    width:100%;
    background-color:#448487;
    position:fixed;
    display:flex;
    align-items:center;
    justify-content:space-between;
    .logo-container{
        cursor:pointer;
    }
    .option{
        margin:0 50px;
        cursor:pointer;
    }
    .left{
        margin-left:200px;
    }
    .right{
        margin-right:200px;
    }

`
export default Header
